import React from 'react';

function Header() {
  return (
    <header style={{ backgroundColor: '#1976d2', color: 'white', padding: '2rem', textAlign: 'center' }}>
      <h1>Dr. Anjali Mehta</h1>
      <p>MBBS, MD - General Physician</p>
    </header>
  );
}

export default Header;
